import React from 'react';
import styled from 'styled-components';

const NowLogoutS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: 80px;
  height: 36px;
  border-radius: 12px;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 100;
  margin-left: ${(props) => props.marginLeft};
  margin-right: ${(props) => props.marginRight};
`;

function NowLogout() {
  return <>
    <NowLogoutS marginLeft="auto">마이페이지</NowLogoutS>
    <NowLogoutS marginRight="10px">좋아요</NowLogoutS>
    <NowLogoutS marginRight="50px">장바구나</NowLogoutS>
    <NowLogoutS marginRight="50px">로그아웃</NowLogoutS>
  </>;
}

export default NowLogout;
